import React, { Component } from 'react';
import UserLookup from './components/UserLookup';
import { Grid, Cell } from 'react-mdc-web/lib';
import {Card, CardHeader, CardTitle, CardText, CardActions, Button} from 'react-mdc-web/lib';


export default class Dashboard extends Component {

  render() {
    return (
      <Grid>
        <Cell col={6}>
          <Card>
            <CardHeader>
              <CardTitle>Member sign in</CardTitle>
            </CardHeader>
            <CardText>
              Please scan your member card. Ask a lifeguard to sign you in below if you forgot your card.
              <br/>
              <br/>
              <UserLookup />
            </CardText>
          </Card>
        </Cell>
      </Grid>
    );
  }
}
